    "full_text" : "Generator expressions can be chained together into pipelines:\n&gt;&gt;&gt; a  = range(9)\n&gt;&gt;&gt; b = (i + i for i in a)\n&gt;&gt;&gt; c = (i * i for i in b)\n&gt;&gt;&gt; d = (i - 5 for i in c)\n&gt;&gt;&gt; list(d)\n[-5, -1, 11, 31, 59, 95, 139, 191, 251]\n\nFor more examples see @dabeaz's  tutorial:\nhttps://t.co/4iS9JdwQUu",
