    "favorited" : false,
    "full_text" : "print() function's sep and end arguments may come in handy:\n\n&gt;&gt;&gt; lst = [\"a\", \"b\", \"c\"]\n&gt;&gt;&gt; print(*lst)\na b c\n&gt;&gt;&gt; print(*lst, sep=\", \")\na, b, c\n&gt;&gt;&gt; print(*lst, sep=\", \", end=\"!!!\\n\")\na, b, c!!!\n\n#python",
    "lang" : "en",
    "contributors" : [ "809800138898206720" ]
