    "created_at" : "Tue Jul 23 06:00:00 +0000 2019",
    "favorited" : false,
    "full_text" : "You might know that ! in #JupyterNotebook, calls a shell command.\n\nBut do you know you can insert the value of Python variable in curly braces into this command?\n\n&gt;&gt;&gt; !head -n3 {path}/{myfile}\n\nOr collect the output from shell?\n\n&gt;&gt;&gt; first_four_lines = !head -n4 myfile\n\nExample: https://t.co/KTOKeRPKFJ",
