    "full_text" : "#Numpy broadcasting can be tricky\n\n&gt;&gt;&gt; import numpy as np\n&gt;&gt;&gt;\n&gt;&gt;&gt; (np.ones((32,)) + np.ones((32,1))).shape\n(32, 32)\n&gt;&gt;&gt; (np.ones((32,)) + np.ones((1,32))).shape\n(1, 32)\n&gt;&gt;&gt; (np.ones((4,1,3)) + np.ones((7,1))).shape\n(4, 7, 3)\n\nWhy? Read two simple rules at https://t.co/iAnh62xI1h https://t.co/iL7s9DyJHI",
