    "full_text" : "#pythontip by @justmarkham:\n\nDid you encounter the dreaded SettingWithCopyWarning in #pandas? üêºüëª\n\nThe usual solution is to rewrite your assignment using \"loc\":\n\n‚ùå df[df.col == val1].col = val2\n‚úÖ df.loc[df.col == val1, 'col'] = val2\n\nSee example üëá https://t.co/8flsDcBWZh",
