    "full_text" : "Be aware that `numpy.isin(a, b)` can return a wrong result if `b` is set: \n\nimport numpy as np\n\na = np.array([[0, 2], [4, 6]])\nb = {1, 2, 4, 8}\n\n# wrong\nnp.isin(a, b)\n# correct\nnp.isin(a, list(b))\n\nAnd in general, `numpy.isin(a, b)` is slow for large `b`.\n\nhttps://t.co/ihrxxlkh2z https://t.co/w8j0LA2nt9",
