    "full_text" : "With the walrus operator\n\nwhile True:\n    line = fp.readline()\n    if not line:\n        break\n    do_something(line)\n\ncan be written as:\n\nwhile line := fp.readline():\n    do_something(line)\n\nMore examples: https://t.co/4WCBSdizFF\n\n#python3_8 #walrusoperator",
    "lang" : "en",
