    "full_text" : "When maxsplit is specified in str.split(), it will limit the number of splits:\n\n&gt;&gt;&gt; s = 'a,,b, c, d,e'\n&gt;&gt;&gt; s.split(',')\n['a', '', 'b', ' c', ' d', 'e']\n&gt;&gt;&gt; s.split(',', maxsplit=2)\n['a', '', 'b, c, d,e']\n&gt;&gt;&gt; s.split(maxsplit=2)\n['a,,b,', 'c,', 'd,e']\n\nhttps://t.co/o3YxgkOwUj",
